REPLACE INTO `kpi` (`kpi_id`, `indicator_statement`, `description`, `frequency`, `data_sources`, `current_target`, `computation`, `subject_area`, `is_cumulative`, `short_name`) VALUES ('KPI-01', 'Percentage of the time the server is online', 'All iHRIS severs up and running 95% of the time\r\nmonitored using third party tool like uptime reboot. ', 'Monthly', 'iHRIS Servers', '95', 'Numerator is the number of Hours uptime and denominator is the total Hours per month', '1', '0', 'Severs up and running ');
REPLACE INTO `kpi` (`kpi_id`, `indicator_statement`, `description`, `frequency`, `data_sources`, `current_target`, `computation`, `subject_area`, `is_cumulative`, `short_name`) VALUES ('KPI-02', 'Monthly Percentage performance of iHRIS databases', 'The indicator measures the percentage of five key reports (staff list, approved norms, search, HF list and Job structure) being generated in the system on a daily basis', 'Monthly', 'iHRIS logs', '95', 'Numerator is the number of times reports generated in a month and denominator is the total days in a month', '1', '0', 'iHRIS databases working ');
REPLACE INTO `kpi` (`kpi_id`, `indicator_statement`, `description`, `frequency`, `data_sources`, `current_target`, `computation`, `subject_area`, `is_cumulative`, `short_name`) VALUES ('KPI-03', 'Percentage of institutions have access accounts to iHRIS', 'The indicator measures the number of active accounts per institution able to access iHRIS', 'Monthly', 'iHRIS Logs', '95', 'Numerator is the number of institutions with user accounts in iHRIS and denominator is the total number of institutions', '1', '0', 'Institutions have access accounts');
REPLACE INTO `kpi` (`kpi_id`, `indicator_statement`, `description`, `frequency`, `data_sources`, `current_target`, `computation`, `subject_area`, `is_cumulative`, `short_name`) VALUES ('KPI-04', '95% of user institutions have HRIS focal persons who login', '95% of user institutions have HRIS focal persons who into iHRIS login and monitored via user logins by any institution user', 'Quarterly', 'iHRIS', '95', 'Numerator is the number of Institutions with a person having logged in and denominator is total number of Institutions using iHRIS.', '2', '0', 'Institutional HRIS focal person login');
REPLACE INTO `kpi` (`kpi_id`, `indicator_statement`, `description`, `frequency`, `data_sources`, `current_target`, `computation`, `subject_area`, `is_cumulative`, `short_name`) VALUES ('KPI-05', ' Institutions have updated staff list report', '95% of user institutions have updated staff list report', 'Quarterly', 'iHRIS', '95', '95% of staff deployed on ground are in iHRIS. Numerator is the number of staff in iHRIS and denominator is total number of staff in an Institution.\r\n', '2', '1', 'Staff list report update');
REPLACE INTO `kpi` (`kpi_id`, `indicator_statement`, `description`, `frequency`, `data_sources`, `current_target`, `computation`, `subject_area`, `is_cumulative`, `short_name`) VALUES ('KPI-06', ' Institutions have updated HRH Audit report', ' Institutions which have updated HRH Audit report', 'Quarterly', 'iHRIS', '95', 'Monitored via all approved norms report having the establishments as per MoPS. \r\nNumerator is the number of institutions with updated Norms and denominator is total number of Institutions.\r\n', '3', '1', 'HRH Audit report');
REPLACE INTO `kpi` (`kpi_id`, `indicator_statement`, `description`, `frequency`, `data_sources`, `current_target`, `computation`, `subject_area`, `is_cumulative`, `short_name`) VALUES ('KPI-07', 'Trainings uploaded  as per HRD ', '95% of training providers have uploaded trainings', 'Quarterly', 'iHRIS Train', '95', 'Numerator is the uploaded trainings and the denominator is the approved trainings', '3', '1', 'Trainings uploaded');
REPLACE INTO `kpi` (`kpi_id`, `indicator_statement`, `description`, `frequency`, `data_sources`, `current_target`, `computation`, `subject_area`, `is_cumulative`, `short_name`) VALUES ('KPI-08', '95% of registration and licensure status reports shared', 'Monitored by checking if data on current registration and licensure numbers is coming in from the 4 HPCs and being uploaded on HRH dashboard', 'Quarterly', 'HRH dashboard', '95', 'Numerator is the number of updated reports from HPCs uploaded and denominator is total number of reports (4 registration and 4 licensure).', '3', '0', 'Registration and licensure status');
REPLACE INTO `kpi` (`kpi_id`, `indicator_statement`, `description`, `frequency`, `data_sources`, `current_target`, `computation`, `subject_area`, `is_cumulative`, `short_name`) VALUES ('KPI-09', '95% of HRH cadre & staffing analysis', 'Monitored by checking if data on cadre and staffing levels is coming in from iHRIS manage and being uploaded on HRH dashboard', 'Monthly', 'iHRIS Manage', '95', 'Numerator is the number of updated HRH reports uploaded and denominator is total number of reports (currently 16) on the dashboard.', '3', '1', 'HRH cadre & staffing analysis');
REPLACE INTO `kpi` (`kpi_id`, `indicator_statement`, `description`, `frequency`, `data_sources`, `current_target`, `computation`, `subject_area`, `is_cumulative`, `short_name`) VALUES ('KPI-10', '95% attendance to duty tracked ', 'Monitored by checking if attendance to duty data is coming in and are being uploaded on HRH dashboard.', 'Quarterly', 'iHRIS Manage', '95', 'Numerator is the number of institutions uploading attendance to duty data and denominator is total number of Institutions where attendance to duty has been rolled out', '3', '1', 'Absenteeism Tracking');
